import React, { Component } from 'react'
import { Button, Container } from 'reactstrap'
import Increment from './Increment'

class ClickCounter extends Component {
  // Initialize State And props
  constructor (props) {
    super (props)
  }

  // Render Button UI
  render () {
    // Extract Props From Increment Method
    const { increment, count } = this.state.props;
    return (
      <Container> <Button onClick={ increment }>Clicked { count } times</Button> </Container>
    )
  }
}

export default Increment (ClickCounter);
